import React, { useState } from 'react';
import { Navbar, Container, Nav, Modal, Button } from 'react-bootstrap';

// Dummy images - replace these imports with your actual images
import companyLogo from '../assets/company-logo.png';
import certificationBadge from '../assets/certification-badge.png';

const sectionsContent = {
  'career-objective': {
    title: 'Career Objective',
    body: (
      <>
        <p>
          Graduate in Bachelor of Information Technology from Melbourne Polytechnic with industry-based project experience.
          Experienced in Python, WordPress, HTML5, CSS, and JavaScript. Previously an IT Software Developer intern at 10th Dan, Melbourne.
          Currently a Multi-Site Store Manager with 5 years customer service experience.
          Seeking to develop an IT career and skillset.
        </p>
        <img src={companyLogo} alt="Company Logo" style={{ width: '150px', marginTop: '20px' }} />
      </>
    ),
  },
  'technical-skills': {
    title: 'Technical Skills',
    body: (
      <>
        <ul>
          <li>HTML5, CSS3, JavaScript, Java, jQuery, ASP .Net, SQL, Python</li>
          <li>WordPress, Shopify</li>
          <li>MySQL, Oracle, SQL Workbench</li>
          <li>AWS, MS Azure, Google Cloud Platform</li>
          <li>Microsoft Office 365, SPSS, ZOHO (CRM)</li>
          <li>User experience testing, black box testing, debugging</li>
          <li>Google Charts, Draw.io</li>
        </ul>
        <img src={certificationBadge} alt="Certification Badge" style={{ width: '150px', marginTop: '20px' }} />
      </>
    ),
  },
  // Add other sections similarly...
};

const NavbarComponent = () => {
  const [showModal, setShowModal] = useState(false);
  const [activeSection, setActiveSection] = useState(null);

  const handleShow = (sectionId) => {
    setActiveSection(sectionId);
    setShowModal(true);
  };

  const handleClose = () => setShowModal(false);

  return (
    <>
      <Navbar bg="dark" variant="dark" expand="lg" fixed="top">
        <Container>
          <Navbar.Brand onClick={() => handleShow('career-objective')} style={{ cursor: 'pointer' }}>
            Swarnim's Portfolio
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ms-auto">
              <Nav.Link onClick={() => handleShow('career-objective')}>Career Objective</Nav.Link>
              <Nav.Link onClick={() => handleShow('technical-skills')}>Technical Skills</Nav.Link>
              {/* Add other nav links similarly */}
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Modal show={showModal} onHide={handleClose} size="lg" centered>
        <Modal.Header closeButton>
          <Modal.Title>{activeSection && sectionsContent[activeSection]?.title}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {activeSection && sectionsContent[activeSection]?.body}
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
};

export default NavbarComponent;
